import { Box } from "@mui/material";
import MyButton from "./MyButton";

const OrderListSecond = ({ setPageNumber }) => {
  return (
    <Box>
      <Box flex>
        <MyButton
          value="이전"
          onClick={() => {
            setPageNumber(1);
          }}
        />
      </Box>
      <Box>
        <MyButton
          value="다음"
          onClick={() => {
            setPageNumber(2);
          }}
        />
      </Box>
    </Box>
  );
};

export default OrderListSecond;
